from typing import *
class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        m = len(mat)
        n = len(mat[0])
        queue = []
        for i in range(m):
            for j in range(n):
                if mat[i][j] == 0:
                    queue.append(((i,j),0))
        table = [[None]*n for _ in range(m)]
        # queue = [(z,0) for z in points]
        while queue:
            [i,j],level = queue.pop(0)
            # print(i,j,level, queue)
            if table[i][j] is not None:
                if table[i][j] > level:
                    table[i][j] = level
                    if i+1 < m:
                        queue.append(((i+1,j),level+1))
                    if i-1 >= 0:
                        queue.append(((i-1,j),level+1))
                    if j+1 < n:
                        queue.append(((i,j+1),level+1))
                    if j-1 >= 0:
                        queue.append(((i,j-1),level+1))
            else:
                table[i][j] = level
                if i+1 < m:
                    queue.append(((i+1,j),level+1))
                if i-1 >= 0:
                    queue.append(((i-1,j),level+1))
                if j+1 < n:
                    queue.append(((i,j+1),level+1))
                if j-1 >= 0:
                    queue.append(((i,j-1),level+1))
        return table
    




